    }

    string GetDayOfWeekInPolish(string DayOfWeek)
    {
        string DayOfWeekPolish = "";
        switch (DayOfWeek)
        {
            case "Monday":
                DayOfWeekPolish = "Poniedziałek";
                break;
            case "Tuesday":
                DayOfWeekPolish = "Wtorek";
                break;
            case "Wednesday":
                DayOfWeekPolish = "Środa";
                break;
            case "Thursday":
                DayOfWeekPolish = "Czwartek";
                break;
            case "Friday":
                DayOfWeekPolish = "Piątek";
                break;
            case "Saturday":
                DayOfWeekPolish = "Sobota";
                break;
            case "Sunday":
                DayOfWeekPolish = "Niedziela";
                break;
        }
        return DayOfWeekPolish;
    }

    string SetMonthToPolishWord(int month)
    {
        string Month = "";
        switch (month)
        {
            case 1:
                Month = "STYCZEŃ";
                break;
            case 2:
                Month = "LUTY";
                break;
            case 3:
                Month = "MARZEC";
                break;
            case 4:
                Month = "KWIECIEŃ";
                break;
            case 5:
                Month = "MAJ";
                break;
            case 6:
                Month = "CZERWIEC";
                break;
            case 7:
                Month = "LIPIEC";
                break;
            case 8:
                Month = "SIERPIEŃ";
                break;
            case 9:
                Month = "WRZESIEŃ";
                break;
            case 10:
                Month = "PAŹDZIERNIK";
                break;
            case 11:
                Month = "LISTOPAD";
                break;
            case 12:
                Month = "GRUDZIEŃ";
                break;
        }
        return Month;
    }

